import React from 'react';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Typography from '@mui/material/Typography';
import gt from '../../pictures/GeorgiaTech.png';
import "../../styles/Education.css";

function Education() {
    return (
        <Paper variant="elevation" sx={{backgroundColor: "#c0bbab", borderRadius: "10px"}} className="paper">
            <Grid container direction="row" alignItems="center" spacing={2} className="grid">
                <Grid item xs={6}>
                    <img src={gt} alt="GT" />
                </Grid>
                <Grid item xs={6}>
                    <Typography variant="subtitle1">Georgia Tech</Typography>
                    <Typography variant="subtitle2">Master's of Science in Computer Science</Typography>
                </Grid>
            </Grid>
        </Paper>
    );
}

export default Education;
